import React from "react";
import "./style.css";

function Scores(props) {
  return <div>
<h1 className="scores">Your Score: {props.scores}</h1>
<h1 className="highscore">Hihg Score: {props.highscore}</h1>
<h5 className="message">High Score: {props.message}</h5>
  </div>

}

export default Scores;
